import React, { useState } from "react";
import "./FiltersSection.css";

export default function FiltersSection() {

 const [isOpen, setIsOpen] = useState(false)
  return (
    <div
      style={{
        backgroundColor: "red",
        width: "300px",
        display: "flex",
        flexDirection: "column",
      }}
    >
      <div style={{backgroundColor:'blue'}} onClick={() => setIsOpen(oldValue => !oldValue)} >Filter</div>  
      <ul style={{ backgroundColor: "green", listStyleType: "none" }}></ul>
    </div>
  );
}
